    <h3 id="welcome-to-Cyber">Cyber Security Section </h3>

    <p id="webdevelopment-description">
      Computer security, cybersecurity or information technology security (IT security)
      is the protection of computer systems and networks from information disclosure,
      theft of or damage to their hardware, software, or electronic data, as well as from
      the disruption or misdirection of the services they provide.

      The field is becoming increasingly significant due to the increased reliance on computer systems, the Internet and
      wireless network standards such as Bluetooth and Wi-Fi, and due to the growth of "smart" devices, including
      smartphones, televisions, and the various devices that constitute the "Internet of things".
      Owing to its complexity, both in terms of politics and technology,
      cybersecurity is also one of the major challenges in the contemporary world.
      The National Security Agency (NSA) is responsible for both the protection of U.S. information systems and also for
      collecting foreign intelligence. These two duties are in conflict with each other. Protecting information
      systems includes evaluating software, identifying security flaws, and taking steps to correct the flaws, which is
      a defensive action. Collecting intelligence includes exploiting security flaws to extract information, which is an
      offensive action. Correcting security flaws makes the flaws unavailable for NSA exploitation.

      The agency analyzes commonly used software in order to find security flaws, which it reserves for offensive
      purposes against competitors of the United States. The agency seldom takes defensive action by reporting the flaws
      to software producers so they can eliminate the security flaws.

      The offensive strategy worked for a while, but eventually other nations, including Russia, Iran, North Korea, and
      China have acquired their own offensive capability, and tend to use it against the United States. NSA contractors
      created and sold "click-and-shoot" attack tools to U.S. agencies and close allies, but eventually the tools made
      their way to foreign adversaries. In 2016, NSAs own hacking tools were hacked and have been used by Russia and
      North Korea. NSAs employees and contractors have been recruited at high salaries by adversaries, anxious to
      compete in cyberwarfare.

      For example, in 2007, the United States and Israel began exploiting security flaws in the Microsoft Windows
      operating system to attack and damage equipment used in Iran to refine nuclear materials. Iran responded by
      heavily investing in their own cyberwarfare capability, which they began using against the United States.

